import './App.css';
import Bio from './components/Bio.js';
import Teaching from './components/Teaching.js';
import ContactInfo from './components/ContactInfo.js';

var contact_info = document.getElementById("contact-info")
var open_contact = document.getElementById("open-contact")
var close_contact = document.getElementById("close-contact")

open_contact.onclick = function() {
    contact_info.style.bottom = "0%";
}

close_contact.onclick = function() {
    contact_info.style.bottom = "10%";
}

function App() {
  return (
	  <div className="App">
	  <div id="top-bar"></div>
	  <div id="main-body">
	  <Bio/>
	  <Teaching/>
	  <ContactInfo/>
	  </div>
	  </div>
  );
}

export default App;
